import React from 'react'
import { useDispatch } from 'react-redux'
import { SetPageTitle } from '../../../_redux/_appStateStore/appStoreAccessor';
import { ILogmessage } from './interfaces/ILogmessage';
import LogTable from '../../../_components/_virtualized/_table/Table';
import { Index } from 'react-virtualized';
import TableColunm from '../../../_components/_virtualized/_table/TableColunm';

interface IProps{
    logmessages: ILogmessage[]
}

const LoggingPageContainer: React.FC<IProps> = (props) =>{

    const {logmessages} = props
    const dispatch = useDispatch();

    dispatch(SetPageTitle("Administration - Logging"))
    
    const columns = React.useMemo(() =>{
        const columns: JSX.Element[] = []
        
        columns.push(<TableColunm key={0} dataKey = "id" width = {50} headerValue = "ID"/>)
        columns.push(<TableColunm key={1}  dataKey = "date" width = {50} headerValue = "Date"/>)
        columns.push(<TableColunm key={2} dataKey = "logMessageType" width = {50} headerValue = "Type"/>)
        columns.push(<TableColunm key={3} dataKey = "message" width = {50} headerValue = "Message"/>)
        columns.push(<TableColunm key={4} dataKey = "exception" width = {50} headerValue = "Exception"/>)
        
        return columns
    },[])

    const rowGetter = React.useCallback((row: Index) =>{
        return logmessages[row.index]
    },[logmessages])

    return(
      <LogTable 
        height={200} 
        width={500} 
        rowHeight={50} 
        rowCount={logmessages.length} 
        headerHeight={100}
        logmessages={logmessages}
        columns={columns}
        getRow={rowGetter}
        />
    )
}

export default LoggingPageContainer
